@@ -1,7 +1,42 @@
 import React from "react";
 
 const SwiperSlide = () => {
-  return <div></div>;
+  return <div>
+    <Swiper
+          modules={[Autoplay]}
+          spaceBetween={0}
+          slidesPerView={8}
+          loop={true}
+          speed={1000}
+          autoplay={{
+            delay: 0,
+            disableOnInteraction: false,
+          }}
+          allowTouchMove={false}
+          grabCursor={true}
+        >
+          {Array(2)
+            .fill(null)
+            .map((_, index) => (
+              <SwiperSlide key={`relume-${index}`}>
+                <div className="flex items-center gap-2 text-white">
+                  <FaCube size={24} />
+                  <p className="font-bold">Relume</p>
+                </div>
+              </SwiperSlide>
+            ))}
+          {Array(2)
+            .fill(null)
+            .map((_, index) => (
+              <SwiperSlide key={`webflow-${index}`}>
+                <div className="flex items-center gap-2 text-white">
+                  <FaWebflow size={24} />
+                  <p className="font-bold">Webflow</p>
+                </div>
+              </SwiperSlide>
+            ))}
+        </Swiper>
+  </div>;
 };
 
 export default SwiperSlide;

